        {
            var v = fr.maxHeaderListSize();
            if (uint32(int(v)) == v)
            {
                return int(v);
            } 
            // They had a crazy big number for MaxHeaderBytes anyway,
            // so give them unlimited header lengths:
            return 0L;
        }

