            httptrace.GotConnInfo ci = new httptrace.GotConnInfo(Conn:cc.tconn);
            cc.mu.Lock();
            ci.Reused = cc.nextStreamID > 1L;
            ci.WasIdle = len(cc.streams) == 0L && ci.Reused;
            if (ci.WasIdle && !cc.lastActive.IsZero())
            {
