            }
            cv, ok = sc.canonHeader[v];
            if (ok)
            {
                return cv;
            }
            if (sc.canonHeader == null)
            {
                sc.canonHeader = make_map<@string, @string>();
            }
            cv = CanonicalHeaderKey(v);
            sc.canonHeader[v] = cv;
            return cv;
        }

