            if (st.gotTrailerHeader)
            {
                return error.As(http2ConnectionError(http2ErrCodeProtocol));
            }
            st.gotTrailerHeader = true;
            if (!f.StreamEnded())
            {
                return error.As(http2streamError(st.id, http2ErrCodeProtocol));
            }
            if (len(f.PseudoFields()) > 0L)
            {
                return error.As(http2streamError(st.id, http2ErrCodeProtocol));
