            // http://tools.ietf.org/html/rfc7540#section-6.6
            if (st.isPushed())
            {
                return error.As(http2ErrRecursivePush);
            } 

            // Default options.
            if (opts.Method == "")
            {
                opts.Method = "GET";
            }
            if (opts.Header == null)
            {
