            var err = http2streamError(cs.ID, f.ErrCode);
            cs.resetErr = err;
            close(cs.peerReset);
            cs.bufPipe.CloseWithError(err);
            cs.cc.cond.Broadcast(); // wake up checkResetOrDone via clientStream.awaitFlowControl
            return error.As(null);
        }

